import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import Card from '@material-ui/core/Card';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';

class Comment extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        const style={
          marginTop:10,
            padding: 10,
        };
        return (
            <Grid item xs={6}>
                <Card style={style}>
                    <Typography variant={"h5"}>{this.props.commentInfo.name}</Typography>
                    <Typography variant={"caption"}>{this.props.commentInfo.email}</Typography>
                    <Typography variant={"body2"}>{this.props.commentInfo.body}</Typography>
                </Card>
            </Grid>
        )
    }
}

export default Comment;
